// @mui material components
import Card from "@mui/material/Card";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";

// Soft UI Dashboard PRO React example components
import DashboardLayout from "examples/LayoutContainers/DashboardLayout";
import DashboardNavbar from "examples/Navbars/DashboardNavbar";
import Footer from "examples/Footer";
import DataTable from "examples/Tables/DataTable";
import Grid from "@mui/material/Grid";
import { Table } from 'react-bootstrap';
// Data

import datatable from "layouts/authentication/error/datatable";
import datatable1 from "layouts/authentication/error/datatable1";
import datatable2 from "layouts/authentication/error/datatable2";

function DataTables() {
  return (
    <DashboardLayout>
      <DashboardNavbar />
      <SuiBox pt={6} pb={3}>


        <SuiBox mb={3}>

        <Grid container spacing={2}>
              <Table striped bordered hover size="sm" style={{ textAlign: "center", borderColor: 'black' }}>
                <thead>
                  <tr>
                    <th style={{ borderColor: 'white', backgroundColor: 'antiquewhite', padding: '15px', width: '200px' }}>Total AUM <br />15.43 Cr</th>

                    <th style={{ borderColor: 'white', backgroundColor: 'antiquewhite', padding: '15px', width: '200px'}}>Total Purchase  <br />25.65 Cr</th>

                    <th style={{ borderColor: 'white', backgroundColor: 'antiquewhite', padding: '15px',  width: '200px' }}>Total Redemption <br />13.95 Cr</th>

                    <th style={{ borderColor: 'white', backgroundColor: 'antiquewhite', padding: '15px',  width: '200px'}}>Total Client<br /> 963</th>

                    <th style={{ borderColor: 'white', backgroundColor: 'antiquewhite', padding: '15px',  width: '200px' }}>Running SIPs At Bse <br />44</th>
                  </tr>
                </thead>
              </Table>
            </Grid>
          <Card>
            <SuiBox p={3} lineHeight={1}>
              <SuiTypography variant="h5" fontWeight="medium">

                TOP AMC AUM
              </SuiTypography>
              {/* <SuiTypography variant="button" fontWeight="regular" textColor="text">
                A lightweight, extendable, dependency-free javascript HTML table plugin.
              </SuiTypography> */}
            </SuiBox>
            <DataTable table={datatable} />
          </Card>
        </SuiBox>
        <Card>
          <SuiBox p={3} lineHeight={1}>
            <SuiTypography variant="h5" fontWeight="medium">
            TOP INVESTORS AUM
            </SuiTypography>
            {/* <SuiTypography variant="button" fontWeight="regular" textColor="text">
              A lightweight, extendable, dependency-free javascript HTML table plugin.
            </SuiTypography> */}
          </SuiBox>
          <DataTable table={datatable1} canSearch />
        </Card>


        <Card>
          <SuiBox p={3} lineHeight={1}>
            <SuiTypography variant="h5" fontWeight="medium">
            CURRENT MONTH SNAPSHOT
            </SuiTypography>
            {/* <SuiTypography variant="button" fontWeight="regular" textColor="text">
              A lightweight, extendable, dependency-free javascript HTML table plugin.
            </SuiTypography> */}
          </SuiBox>
          <DataTable table={datatable2} />

        </Card>

      </SuiBox>
      <Footer />
    </DashboardLayout>
  );
}

export default DataTables;
